import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";

// Pages
import Login from "./pages/login";
import Register from "./pages/register";
import Dashboard from "./pages/dashboard";
import KYCStep1 from "./pages/kyc-step1";
import KYCStep2 from "./pages/kyc-step2";
import KYCStep3 from "./pages/kyc-step3";
import KYCStep4 from "./pages/kyc-step4";
import KYCStep5 from "./pages/kyc-step5";
import Result from "./pages/result";

function App() {
  return (
    <Router>
      <Routes>
        {/* Auth routes */}
        <Route path="/" element={<Navigate to="/login" />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Dashboard */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* KYC Steps */}
        <Route path="/kyc-step1" element={<KYCStep1 />} />
        <Route path="/kyc-step2" element={<KYCStep2 />} />
        <Route path="/kyc-step3" element={<KYCStep3 />} />
        <Route path="/kyc-step4" element={<KYCStep4 />} />
        <Route path="/kyc-step5" element={<KYCStep5 />} />

        {/* Result page */}
        <Route path="/result" element={<Result />} />

        {/* Fallback */}
        <Route path="*" element={<h1 className="text-center mt-10 text-2xl">404 - Page Not Found</h1>} />
      </Routes>
    </Router>
  );
}

export default App;
